window.bookSummaryJSON = "<p>Stranded on a remote planet with no hope of escape.</p> <p>Stuck in the unforgiving wilderness, where monsters hunt in the skies above.</p> <p>No signal, no spacecraft, no translator.</p> <p>Esania thought she and her people were escaping to the sanctuary planet of Torandor. Instead, she's ended up on a wild, uncharted nightmare called Khira, where the violet-skinned savages who guard them are just as poisonous as the deadly flora and fauna.</p> <p>And the pale-winged demon who's just dropped from above might be the most dangerous of them all.</p> <p>Contains mature themes.</p>"; 
